rams, compromise your phone\'s security features, and could mean that the 963 application won\'t work properly or at all.\n\nYou should be aware that there are certain things that ArtFly will not take responsibility for. Some functions of the application will require the application to have an active internet connection. The connection can be via Wi-Fi or provided by your mobile network provider, but ArtFly cannot take responsibility for the application not working at full functionality if you don\'t have access to Wi-Fi, and you don\'t have any other internet connection.\n\nWith respect to ArtFly\'s responsibility for your use of the application, when using the application, it\'s important to bear in mind that although we endeavor to ensure that it is updated and correct at all times, we do rely on third parties to provide information to us so that we can make it available to you. ArtFly accepts no liability for any loss, direct or indirect, you experience as a result of relying wholly on this functionality of the application.\n\nChanges to These Terms and Conditions\nWe may update our Terms and Conditions from time to time. Thus, you are advised to review this page periodically for any changes. We will notify you of any changes by posting the new Terms and Conditions on this page.\n\nThese terms and conditions are effective as of 2024-09-01';

